export const VehicleContext = React.createContext();

export function VehicleProvider({ children }) {

  const [placa, setplaca] = React.useState('')
  const [toVehicleRoute, setoVehicleRoute] = React.useState(false)
 
  return (
      <VehicleContext.Provider value={{placa, setplaca, toVehicleRoute ,setoVehicleRoute}}>
        {children}
      </VehicleContext.Provider>
  );
}
